import React from 'react';
import { Link } from 'react-router-dom';
import background from './media/Background.jpg'


const Header = () => {
	return(
		<div className="ui vertical masthead center aligned">
				
				<div className="ui image">
  				<img 
  					src={background} 
  					alt="background image" 
  					style={{
  						backgroundPosition: 'top right', 
  						backgroundSize: 'cover',
  						backgroundRepeat: 'no-repeat',
  						backgroundAttachment: 'scroll'
  					}}
  				/>
    			<div className="ui header huge" style={{position: 'absolute', bottom: '40%', left: 100, width: '100%', height: 'auto', color: '#fff'}}>Sarah Brackett</div>

					<div className="ui container" style={{position: 'absolute', top: '5%', right: '5%', width: '100%', height: 'auto'}}>
						<div className="ui large secondary pointing menu" >
						<Link to="/" className="ui inverted basic button">
							News
							</Link>
							<Link to="/about" className="ui inverted basic button">
								About
							</Link>
							<Link to="/videos" className="ui inverted basic button">
								Videos
							</Link>
							<Link to="/gallery" className="ui inverted basic button">
								Gallery
							</Link>
							<Link to="/contact" className="ui inverted basic button">
								Contact
							</Link>
						</div>
					</div>
				</div>
				
			</div>
	);
};

export default Header;
